import * as React from 'react';
import { Data } from './Sex';

interface IAgeGroupProps {
  totalData: Array<Data>;
}

const AgeGroup: React.FunctionComponent<IAgeGroupProps> = ({ totalData }) => {
  const fiftys = totalData.filter((a) => a.ageGroup === '50 to 59');
  const fortys = totalData.filter((a) => a.ageGroup === '40 to 49');
  const thirtys = totalData.filter((a) => a.ageGroup === '30 to 39');
  const twenties = totalData.filter((a) => a.ageGroup === '20 to 29');
  const teens = totalData.filter((a) => a.ageGroup === '10 to 19');

  return <div>console.log</div>;
};

export default AgeGroup;
